import React, { Component } from 'react'
import { withRouter } from "react-router-dom";
import GoogleMapReact from 'google-map-react';
import Rating from 'react-rating';

import NavBar from "../components/NavBar";
import RewardSelector from "../components/RewardSelector";

import leafTranslucent from '../assets/leaf-translucent.svg'
import leafOpaque from '../assets/leaf-opaque.svg'
import locMarker from '../assets/leaf-opaque.svg'


const AnyReactComponent = ({ text }) => <div>
    <img src={locMarker} width={50} height={50}/>
</div>;

class RestaurantDetails extends Component {

    constructor(props) {
        super(props)

        this.state = {

        }

    }

    logInUser = (user) => {
        this.props.logInUser(user)
    }

    logOutUser = () => {
        this.props.logOutUser()
    }

    goToProfile = () => {
        this.props.history.push('/user/' + this.props.user.name)
    }

    signUpUser = (user) => {
        this.props.signUpUser(user)
    }

    static defaultProps = {
        center: {
            lat: -37.798404,
            lng: 144.963211
        },
        zoom: 13
    };


    render() {


        return(
            <div>
                <NavBar
                    {...this.props}
                    logOutUser={this.logOutUser}
                    logInUser={this.logInUser}
                    signUpUser={this.signUpUser}
                    userLoggedIn={this.props.userLoggedIn}
                    goToProfile={this.goToProfile}
                />

                <div className='restaurant-detail-container'>

                    <RewardSelector />

                    <div className='restaurant-detail-title'>
                        THE VEGIE BAR
                    </div>
                    <div className='restaurant-detail-photo'>
                        <img src='data:image/jpeg;base64,'
                             alt='restaurant photo'
                             style={{flex: 1}}
                        />
                    </div>
                    <div className='restaurant-detail-info'>
                        <p>Vegetarian Cafe</p>
                        <p>RATING</p>

                        <Rating
                            initialRating={4}
                            emptySymbol={
                                <img
                                    width={30}
                                    height={30}
                                    src={leafTranslucent}
                                />
                            }
                            fullSymbol={
                                <img
                                    width={30}
                                    height={30}
                                    src={leafOpaque}
                                />
                            }

                        />
                        <p>380, Brunswick St, Fitzroy VIC 3065</p>
                        <p>Resto website</p>

                        <p>0442 124 244</p>
                    </div>
                    <div className='restaurant-detail-map'>
                        <GoogleMapReact
                            bootstrapURLKeys={{ key: 'AIzaSyAThroloBz4lBlrWA_ZCmtXfOFdsI46CXY' }}
                            defaultCenter={this.props.center}
                            defaultZoom={this.props.zoom}
                        >
                            <AnyReactComponent
                                lat={-37.798404}
                                lng={144.963211}
                                text="My Marker"
                            />
                        </GoogleMapReact>
                    </div>

                    <div className='restaurant-detail-about'>
                        <h2>About</h2>
                        <p>Lorem ipusm akdjvakljvbadlkfvba adlj ba ajf nnkjdf naj nnlakjfn ljafnvljaf nlkvjafnnlkjn </p>

                        <h2>Sustainable Practices</h2>
                        <p>Lorem ipusm akdjvakljvbadlkfvba adlj ba ajf nnkjdf naj nnlakjfn ljafnvljaf nlkvjafnnlkjn </p>
                    </div>
                    <div className='restaurant-detail-rewards'>
                        STUFF
                    </div>

                    <div className='restaurant-detail-reviews-title'>
                        Reviews
                    </div>
                    <div className='restaurant-detail-reviews'>
                        <div className='restaurant-detail-reviews-item'>
                            <p>date user rating</p>
                            Lorem ipasusma akj nkaj ajdfnalksdjfn nlakjd asdjfn aksdjnf aslkjdfn alskdjf nlaskdjfn nalksjnf klasbfakd vbuann liruvnsr lsn
                        </div>


                        <div className='restaurant-detail-reviews-item-void'>
                        </div>
                    </div>
                </div>
            </div>
        )
    }


}


export default withRouter(RestaurantDetails)
